INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (1,68500,NULL,76,3,1976,4,0,0,1,'Stanovanje se prodaja opremljeno. Stanovanjski blok ima obnovljeno streho in balkone. Prav tako so lastniki v celotni obnovili kopalnico. Sama lega je odlična saj je stanovanje na južni strani in ima dva balkona, enega na vzhodni in drugega na zahodni strani. ',NULL,NULL,0,'2018-06-08',1,1,2);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (2,230000,400,5543,NULL,1982,NULL,2010,1,NULL,'V naravnem in mirnem okolju na Velikem vrhu pri Novem Mestu, vam v nakup lahko ponudimo prostorno stanovanjsko hišo z gospodarskim poslopjem. Lepa lega hiše ob gozdu in travniku, dovolj bivalnega prostora za bivanje vaše družine in dodaten prostor, ki vam lahko služi za poslovno rabo je odlična nakupna priložnost.','Samostojna',NULL,0,'2018-06-08',29,2,2);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (3,30000,NULL,800,NULL,NULL,NULL,NULL,NULL,NULL,'V umirjenem naravnem okolju kjer ste deležni sončnih žarkov preko celotnega dne je na prodaj stavbno zemljišče kot del večjega (1.600m2) zemljišča. Vsa komunalna in energetska infrastruktura se nahaja že na parceli oz. v neposredni bližini. Na zemljišču stojta dva objekta, ki ju je potrebno porušiti.',NULL,'Zazidljiva',0,'2018-06-08',28,3,2);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (4,44900,NULL,1058,NULL,NULL,NULL,NULL,NULL,NULL,'V Latkovi vasi je na prodaj zemljišče z odlično južno lego. Nahaja se v mirnem predelu naselja, do tja se pripeljete po javni asfaltni cesti (slepa ulica), ki nadalje vodi do maloštevilnih hiš - torej v tem delu praktično ni prometa. \r\n\r\nNa parceli se že nahaja kanalizacijski jašek, telekomunikacijska omarica. Vodovodno in elektro omrežje poteka ob parcelni meji s cesto. ',NULL,'Zazidljiva',0,'2018-06-08',4,3,1);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (5,60000,NULL,48,3,1990,2,2007,0,0,'Stanovanje se nahaja v 2.nadstropju. Sestavljajo ga 2 spalnici in bivalna kuhinja ter kopalnica. Stanovanje je bilo obnoljeno leta 2007.\r\nV stanovanju ostane kuhinja z belo tehniko, jedilni kot ter vgradni elementi.',NULL,NULL,0,'2018-06-08',27,1,1);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (6,129000,450,130,NULL,2015,NULL,0,0,NULL,'Odlična priložnost za nakup hiše na izjemni lokaciji. Nameščene so grobe inštalacije in estrihi.','Samostojna',NULL,0,'2018-06-08',26,2,1);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (7,105000,NULL,140,5,1930,1,2008,0,1,'Dve ločeni stanovanjski enoti, neposredna bližina bolnice nudi možnost ureditve zasebne ambulante, parkirna mesta',NULL,NULL,0,'2018-06-08',25,1,4);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (8,198000,250,1150,NULL,2008,NULL,0,0,NULL,'Novejša energetsko varčna hiša, velika parcela, blizu AC priključka...','Samostojna',NULL,0,'2018-06-08',24,2,4);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (9,18000,NULL,650,NULL,NULL,NULL,NULL,NULL,NULL,'V bližini se nahaja vsa potrebna infrastruktura kot so voda, elektrika, telekomunikacije in dostop. Za posamezne objekte so predvidene čistilne naprave.\r\nSama lokacija je zelo prijetna in mirna.',NULL,'Nezazidljiva',0,'2018-06-08',23,3,4);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (10,150000,NULL,5400,NULL,NULL,NULL,NULL,NULL,NULL,'Osončenost zagotovljena preko celotnega dne. V mestecu, ki je oddaljeno le nekaj minut vožnje se nahaja vrtec, šola, zdravstveni dom, trgovine, športne površine, gostinska ponudba in še marsikaj. Avtocestni uvoz je oddaljen cca 4km. ',NULL,'Zazidljiva',0,'2018-06-08',10,3,5);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (11,90000,140,241,NULL,1937,NULL,0,0,NULL,'Ponujamo stanovanjsko hišo primerno za bivanje več oseb ali stanovnjsko rabo. V prvi etaži hiše je eno in dvsobno stanovanje. V drugi etaži se nahaja 3-sobno stanovnaje. Hiša ima 6 sob, 2 kopalnice in 3 kuhinje. Pripadajoče funkcionalno zemljišče je velikosti 241.','Samostojna',NULL,0,'2018-06-08',11,2,5);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (12,77000,NULL,117,4,1967,1,2004,0,0,'V Arclinu, le 2-3 minuti od Celja in AC priključka, vam v nakup ponujamo večje stanovanje v dveh etažah. Stanovanje in pripadajoči prostori so skupne velikosti cca.117m2 ter predstavljajo 2/3 večstanovanjske hiše. ',NULL,NULL,0,'2018-06-08',12,1,5);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (13,650000,2400,3000,NULL,1978,NULL,2001,1,NULL,'Na prodaj EPF Maribor. Ne sprašujte zakaj, tudi jaz ne vem.','Vrstna',NULL,0,'2018-06-08',13,2,4);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (14,59000,100,180,NULL,1962,NULL,0,0,NULL,'Na lokaciji ob cesti vam v nakup lahko ponudimo manjšo stanovanjsko hišo. Hiša je dvo-etažna. V pritlični etaži se nahaja kurilnica in trije pomožni prostori. V nadstropju se nahaja kuhinja, 3 sobe, stranišče in zidana niša, kjer se nahaja tuš kabina. Vsaka etaža meri cca.50 m2.','Samostojna',NULL,0,'2018-06-08',30,2,3);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (15,185000,117,530,NULL,2018,NULL,0,1,NULL,'Nimate časa, da bi se ukvarjali z gradnjo? Si tudi vi želite, da bi se lahko vaši otroci igrali v gozdu, v objemu narave, odmaknjeni od mestnih ulic? Bi se želeli po naporni službi spočiti na terasi s pogledom na drevesa in bližnje travnike? Bi se radi sprehodili skozi gozd do jezera, odjezdili s sosedovim konjem čez travnike ali odigrali golf na bližnjem golfišču?','Samostojna',NULL,0,'2018-06-08',31,2,3);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (16,124900,128,520,NULL,2018,NULL,0,1,NULL,'SAMO ŠE DVE ENOTI. V mirnem delu novo rastočega dela naselja v Ločica ob Nekireki, sta v gradnji dve stanovanjski hiši (dvojčka) z lepo sončno lego in vso potrebno infrastrukturo v neposredni bližini.','Dvojček',NULL,0,'2018-06-08',32,2,3);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (17,130000,NULL,89,3,1993,2,0,1,1,'Stanovanje sestavljajo 2 spalnici, dnevni prostor, ki je povezan s kuhinjo in balkonom, shramba in kopalnica.\r\n\r\nPredmet nakupa je tudi oprema stanovanja.\r\nStanovanje se prodaja skupaj z garažo.',NULL,NULL,1,'2018-06-08',33,1,3);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (18,120000,NULL,56,3,2004,2,2012,0,0,'V stanovanju je razporejena predsoba, kuhinja z jedilnico in dnevno sobo, otroška soba, kopalnica z masažno banjo, tušem in WC-jem, utility ter spalnica z manjšo kopalnico. Stanovanje ima zelo razgibano razporeditev, saj so vsi prehodi urejeni iz predsobe, do spalnice z manjšo kopalnico pa so urejene stopnice iz dnevnega prostora. ',NULL,NULL,0,'2018-06-08',34,1,3);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (19,95000,NULL,169,5,1875,2,0,0,0,'Velike sobane, visoki stropi in številni prostori vam ponujajo odlično priložnost ustvariti si nadstandardni dom.',NULL,NULL,0,'2018-06-08',19,1,3);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (20,42000,NULL,764,NULL,NULL,NULL,NULL,NULL,NULL,'Prodamo zazidljivo parcelo na odlični lokaciji na robu mestnega jedra v Portorožu. Parcela s sončno lego je od centra Portoroža oddaljena 1 minuto hoje. Je rahlo dvignjena nad mestom in ima posledično lep razgled v smeri obale.',NULL,'Zazidljiva',0,'2018-06-08',36,3,3);
INSERT INTO `nepremicnina` (`idNepremicnina`,`cena`,`kvadraturaBivalnegaProstora`,`skupnaKvadratura`,`steviloSob`,`letoIzgradnje`,`nadstropje`,`letoPrenove`,`garaza`,`balkon`,`opis`,`vrstaHise`,`tipPosesti`,`prodano`,`datumObjave`,`tk_id_naslov`,`tk_id_vrstaNepremicnine`,`Agent_idAgent`) VALUES (21,50000,NULL,8614,NULL,NULL,NULL,NULL,NULL,NULL,'V lepem, mirnem okolju, v Vinski Gori pri Velenju, prodamo posest, velikosti 8614 m2. Na posesti stojijo trije starejši objekti, stanovanjska hiša in dva nestanovanjska objekta, ki so pod spomeniškim varstvom. Na posest je pripeljan komunalni priključek za vodo in elektriko. Objekti so v slabem stanju in bo možna nadomestna gradnja.',NULL,'Kmetijsko zemljišče',1,'2018-06-08',35,3,3);
